import React from "react";
import { Link } from "react-router-dom";
import { FaBlogger, FaComments, FaUsers, FaPhoneAlt, FaInfoCircle } from "react-icons/fa";
import "../compo/HomePage.css";

const LandingPage = () => {
  return (
    <div className="landing-container">
      {/* Navbar */}
      <nav className="navbar">
        <div className="logo">MuteCall</div>
        <div className="nav-links">
          <Link to="/">Home</Link>
          <Link to="/about">About</Link>
          <Link to="/features">Feature</Link>
          <Link to="/blog">Blog</Link>
        </div>
        <Link to="/signup" className="signup-btn">Sign Up</Link>
      </nav>

      {/* Hero Section */}
      <section className="hero">
        <h1 className="hero-title">
          Bridging Communication Gaps with <br /> AI-Powered Sign Language Detection!
        </h1>
        <p className="hero-subtitle">Making conversations effortless with smart sign language detection.</p>
        <div className="hero-buttons">
          <button className="primary-btn">Get a Demo</button>
          <button className="secondary-btn">Sign Up</button>
        </div>
      </section>

      {/* Features Section */}
      <section className="features">
        <h2 className="section-title">Features Designed for the Deaf Community</h2>
        <div className="feature-grid">
          <div className="feature-item"><FaComments size={30} /> Chat</div>
          <div className="feature-item"><FaBlogger size={30} /> Blog</div>
          <div className="feature-item"><FaUsers size={30} /> Join</div>
          <div className="feature-item"><FaPhoneAlt size={30} /> Call</div>
          <div className="feature-item"><FaInfoCircle size={30} /> Info</div>
        </div>
      </section>

      {/* Footer */}
      <footer className="footer">
        <p>Â© 2025 MuteCall. All Rights Reserved.</p>
      </footer>
    </div>
  );
};

export default LandingPage;
